import React, { Component } from 'react';


class  Prstest extends Component{
    constructor(){
        super()
        this.info= {
            img:'/images/test1.jpg',
            nom:'salah eddine chhoub' ,
            travail:'develppeur' ,
            email:'salaheddine@gamil.com' ,
            telephone:'0612325246' ,
            website:'ww.tets.com'
        }
    }

    render(){
        return (
            <div className='mt-5 col-md-4 col-sm-6  text-center'>
                <div className='card'>
                    <div className='card-header'>
                        <img style={{maxWidth:'100%'}} src={this.info.img} alt='' />
                    </div>
                    <div className='card-body' style={{ backgroundColor : this.props.info.website ? 'white' : 'aquamarine'}}>
                        <h5 >{this.props.info.nom}</h5>  
                        <p>{this.props.info.travail}</p>
                        <p>{this.props.info.email}</p>
                        <p>{this.props.info.telephone}</p>
                        <p>{this.props.info.website}</p>
                    </div>
                </div>    
            </div>
        );
    }
   
}

export default Prstest;
